import PropTypes from 'prop-types'
import { withTranslation } from '../i18n'
import styles from '../styles/support.module.sass'

const Motivation = ({t, linklist}) => {
    return (
        <div className={styles.home}>
        <div className={styles.space}>
        <ul className={styles.motivation}>
        {linklist.map((link) => (
        <li><a href={link.href}>{link.title}</a></li>
      ))}
        </ul>
      </div>
      </div>
    )
}

Motivation.getInitialProps = async () => ({
    namespacesRequired: ['common'],
  })

  Motivation.propTypes = {
    t: PropTypes.func.isRequired,
  }

  export async function getStaticProps() {
    const res = await fetch('../resources/links.json')
    const links = await res.json()
    return {
      props: {
        links,
      },
    }
  }

export default withTranslation('common')(Motivation)
